import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import uuid from 'react-uuid';

import './style.css';

class Inventory extends Component {
    constructor(props) {
        super(props);
        this.state = {
            inventory: false
        }
    }

    render() {
        let inventory =
        this.props.inventory.map(inventory => (
            <p key={inventory.id}><Link to={`/stores/${store.id}`}>{store.store_name} - {store.store_city}, {store.store_state}</Link></p>
        )); 

        return (
            <div>
                <h2>Current Inventory:</h2>
                {inventory}
            </div>
        )
    }
}

export default Inventory
